	def Q(self, n, k, r):
		if (n, k, r) not in self.Q_:
			self.Q_[(n, k, r)] = factorial(n) * factorial(k + r) / factorial(k) / factorial(n + r)
		return self.Q_[(n, k, r)]


	def M(self, t, v, u, w):
		if t >= v >= 0 and u >= w >= 0:
			if (t, v, u, w) not in self.M_:
				self.M_[(t, v, u, w)] = np.outer(self.mu[(self.j, self.c, self.d, u, w)], self.mu[(self.i, self.a, self.b, t, v)])
			return self.M_[(t, v, u, w)]
		return 0


	def PlotReconstructionStatistics(self, image, mean, std, show=True):
		sampling = fftconvolve(image, np.outer(self.BSplinej, self.BSplinei))
		sampling += np.random.normal(mean, std, sampling.shape)
		M = []
		for r in range(self.n + 1):
			for s in range(self.m + 1):
				row1 = []
				row2 = []
				for k in range(self.n + 1):
					for l in range(self.m + 1):
						row1.append(self.Q(self.n, k, r) * self.Q(self.m, l, s) * np.sum((self.M(self.n + r - 1, k + r - 1, self.m + s, l + s) - self.M(self.n + r - 1, k + r, self.m + s, l + s)) * sampling))
						row2.append(self.Q(self.n, k, r) * self.Q(self.n, l, s) * np.sum((self.M(self.n + r, k + r, self.m + s - 1, l + s - 1) - self.M(self.n + r, k + r, self.m + s - 1, l + s)) * sampling))
				M.append(row1)
				M.append(row2)
			reconstruction = self.ConstructImage(minimize(lambda alpha: np.linalg.norm(M @ alpha), np.ones((self.n + 1) * (self.m + 1)), method='Powell').x, self.GetSeparableBasis(self.n, self.a, self.b, self.m, self.c, self.d))
		if show:
			plt.figure()
			plt.imshow(image)
			plt.title('image')
			plt.axis('off')
			plt.gray()
			plt.figure()
			plt.imshow(sampling)
			plt.title('sampling')
			plt.axis('off')
			plt.gray()
			plt.figure()
			plt.imshow(reconstruction)
			plt.title('reconstruction')
			plt.axis('off')
			plt.gray()
			plt.figure()
			plt.imshow(abs(image - reconstruction))
			plt.title('error')
			plt.axis('off')
			plt.gray()
			plt.show()
		return self.SorensenDiceCoefficient(image, reconstruction)


